Defendant in Court, in custody with Atty. Joan Broughton. District Attorney Law Intern for the State of Wisconsin.    Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.  Count 2 is dismissed and read in.

The Court Orders the Following:

Imposed and Stayed Sentence of:

 7 Years Imprisonment (Credit - 31 days )
- 4 Years of Initial Confinement
-  3 Years of Extended Supervision

Term of Probation: 3 Years

Conditions of Probation:
- Become involved in AA or NA;
-Obtain a menor within 30 days;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Do what's necessary to obtain a license if lost;
- Operate a Motor Vehicle with a Valid Drivers License;
- Maintain/Obtain full time employment;
-Write a letter of apology to each victim within 30 days;
- Provide DNA sample if not yet provided  and pay surcharge

Restitution: $1,800.00 to Connie and Melvin D.  and $1,000.00 to MetLife Wilber and Associates  (to be paid as a condition of probation at the rate of $150.00 per month  commencing 11-3-14)

Costs: $278.00 
DNA Surcharge:  $250.00
(To to be paid as a condition of probation alternate 53 hours of community service to be completed by end of probation.   Court must receive notice of completion prior to due date.)

Condition Time: 6 months Huber NON WORKING HOURS WITH STANDARD RELEASE CONDITIONS - Stayed and to be used at the agent's discretion.   Defendant to be released on 8-15-14 for 90 days of Day Report Center.  If defendant successfully completes the day report center those 90 days count towards the condition time.  

Defendant is not eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
